No puedo completar con certeza el poema. Reconozco que son versos que parecen de estilo modernista o romántico, pero no puedo identificar con precisión su autor ni su continuación exacta. Lo que sí aprecio es que parece un soneto o fragmento de una composición poética descriptiva de una ascensión, con un tono muy lírico.
